-- Eliminación de tabla (descomenta si necesitas recrear)
-- DROP TABLE IF EXISTS ilc_predio CASCADE;

CREATE TABLE ilc_predio (
	objectid int4 NOT NULL,
	id_operacion varchar(255) NULL,
	codigo_orip varchar(255) NULL,
	matricula_inmobiliaria varchar(255) NULL,
	area_catastral_terreno numeric(38, 8) NULL,
	numero_predial_nacional varchar(30) NULL,
	tipo varchar(255) NULL,
	condicion_predio varchar(255) NULL,
	destinacion_economica varchar(255) NULL,
	area_registral_m2 numeric(38, 8) NULL,
	tipo_referencia_fmi_antiguo varchar(255) NULL,
	coeficiente numeric(38, 8) NULL,
	area_coeficiente numeric(38, 8) NULL,
	globalid varchar(38) DEFAULT '{00000000-0000-0000-0000-000000000000}'::character varying NOT NULL,
	predioinformal_guid varchar(38) DEFAULT '{00000000-0000-0000-0000-000000000000}'::character varying NULL,
	municipio varchar(5) NULL,
	referencia_registral varchar(255) NULL,
	gdb_geomattr_data bytea NULL,
	shape text NULL
);


